import React, {useRef} from "react";
import {Link} from "react-router-dom";
import '../components/Navbar.css';

function Navbar(){
    let link = useRef(null);
    let burger = useRef(null);
    let ul = useRef(null);

    const handelMenu = (e) =>{
        e.preventDefault();
        burger.classList.tooggle('open');
        ul.classList.tooggle('open');
        console.log('ok');
    }
    return (<nav>
    <a ref={link} href="#" onClick={handelMenu} className="link"><span className="burger" ref={burger}></span></a>
        <ul ref={ul} class="list_menu">
            <li><Link to='/'>Home</Link></li>
            <li><Link to='/about'>A propos</Link></li>
            <li><Link to='/events'>Stages</Link></li>
            <li><Link to='/cours'>Cours de Danse</Link></li>
            <li><Link to='/solidaire'>Activit√©s Solidaires</Link></li>
            <li><Link to='/contact'>Contact</Link></li>
        </ul>
    </nav>

    )}

export default Navbar;
